import React, {Component} from 'react';
import {sendInputValue} from "../api/InputValues";
import { Route, Link} from 'react-router-dom';
import '../style/auth.css';

class Auth extends Component {
    clickHandler() {
        const name = document.getElementById("name").value;
        const surname = document.getElementById("surname").value;
        const email = document.getElementById("email").value;
        const password = document.getElementById("password").value;
        sendInputValue(name, surname, email, password);
    }

    render() {
        return (
            // <body>
            //     <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
            //     <script src="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/3.3.7/js/bootstrap.min.js"></script>
            //     <div class="container">
                    <div class="row">
                        <div class="col-md-offset-3 col-md-6">
                                <div class="tab" role="tabpanel">
                                   <ul class="nav nav-tabs" role="tablist">
                                       <li role="presentation" class="active"><a href="#Section1" aria-controls="home" role="tab" data-toggle="tab">Войти</a></li>
                                       <li role="presentation"><a href="#Section2" aria-controls="profile" role="tab" data-toggle="tab">Регистрация</a></li>
                                   </ul>
                                </div>
                                <div class="tab-content tabs">
                                    <div role="tabpanel" class="tab-pane fade in active" id="Section1">
                                        <form class="form-horizontal">
                                            <div class="form-group">
                                                <label for="exampleInputEmail1">Email</label>
                                                <input type="email" class="form-control" id="exampleInputEmail1"></input>
                                            </div>
                                            <div class="form-group">
                                                <label for="exampleInputPassword1">Пароль</label>
                                                <input type="password" class="form-control" id="exampleInputPassword1"></input>
                                            </div>
                                            <div class="form-group">
                                                <div class="main-checkbox">
                                                    <input value="None" id="checkbox1" name="check" type="checkbox"></input>
                                                    <label for="checkbox1"></label>
                                                </div>
                                                <span class="text">Запомнить</span>
                                            </div>
                                            <div class="form-group">
                                                <button type="submit" class="btn btn-default">Войти</button>
                                            </div>
                                            <div class="form-group forgot-pass">
                                                <button type="submit" class="btn btn-default">Забыли пароль</button>
                                            </div>
                                        </form>
                                    </div>
                                    <div role="tabpanel" class="tab-pane fade" id="Section2">
                                        <form class="form-horizontal">
                                            <div class="form-group">
                                                <label for="exampleInputEmail1">Имя</label>
                                                <input type="text" class="form-control" id="exampleInputEmail1"></input>
                                            </div>
                                            <div class="form-group">
                                                <label for="exampleInputEmail1">Фамилия</label>
                                                <input type="text" class="form-control" id="exampleInputEmail1"></input>
                                            </div>
                                            <div class="form-group">
                                                <label for="exampleInputEmail1">Email</label>
                                                <input type="email" class="form-control" id="exampleInputEmail1"></input>
                                            </div>
                                            <div class="form-group">
                                                <label for="exampleInputPassword1">Пароль</label>
                                                <input type="password" class="form-control" id="exampleInputPassword1"></input>
                                            </div>
                                            <div class="form-group">
                                                <button type="submit" class="btn btn-default">Зарегистрироваться</button>
                                            </div>
                                        </form>
                                    </div>
                                </div>
                            </div>
                        </div>
            //      </div>
            //  </div>
            //</body>
        );
    }   
}
export default Auth;
